int active()
{
    int ret;

    ret = super();
    journalFormTrans.datasourceActivePost();

    pmfFrmCtrl.dataSourceActivePost();

    if (#PdsBatchAttribEnabled)
    {
        if (InventDim::find(prodJournalProd.InventDimId).InventBatchId)
        {
            pdsBatchAttributesInput.visible(false);
            pdsBatchAttributes.visible(true);
        }
        else
        {
            pdsBatchAttributesInput.visible(true);
            pdsBatchAttributes.visible(false);
        }
    }

    return ret;
}

